int width;
int height;

#define WIDTH       width
#define HEIGHT      height
#define HALF_WIDTH  (WIDTH / 2)
#define HALF_HEIGHT (HEIGHT / 2)

#define PI          3.14159265358979323846

float reduce(float x)
{
    while (x > PI) x -= 2 * PI;
    while (x < -PI) x += 2 * PI;
    return x;
}

float _cos(float x)
{
    x = reduce(x);
    float x2 = x * x;

    return 1 - x2 / 2.0 + x2 * x2 / 24.0 - x2 * x2 * x2 / 720.0 + x2 * x2 * x2 * x2 / 40320.0;
}

float _sin(float x)
{
    x = reduce(x);
    float x2 = x * x;

    return x * (1 - x2 / 6.0 + x2 * x2 / 120.0 - x2 * x2 * x2 / 5040.0 + x2 * x2 * x2 * x2 / 362880.0);
}

float _tan(float x)
{
    return _sin(x) / _cos(x);
}

int fb;
uint32_t* backbuf;
float* depthbuf;

void clear_screen(uint32_t color)
{
    for (int i = 0; i < WIDTH * HEIGHT; i++)
    {
        backbuf[i] = color;
        depthbuf[i] = (float)0x7f7fffff;
    }
}

void blit()
{
    lseek(fb, 0, SEEK_SET);
    write(fb, backbuf, WIDTH * HEIGHT * sizeof(uint32_t));
}

