struct mat4x4
{
    float m[4][4];
};

struct mat4x4 get_translation(float x, float y, float z)
{
    struct mat4x4 m = {
        .m = {
            {1, 0, 0, x},
            {0, 1, 0, y},
            {0, 0, 1, z},
            {0, 0, 0, 1}
        }
    };

    return m;
}

struct mat4x4 get_projection(float near, float far, float fov, float aspect)
{
    struct mat4x4 m = { 0 };

    float f = 1.0f / _tan(fov / 2.0f);
    m.m[0][0] = f / aspect;
    m.m[1][1] = f;
    m.m[2][2] = (far + near) / (far - near);
    m.m[2][3] = (-2.0f * far * near) / (far - near);
    m.m[3][2] = 1;

    return m;
}

struct mat4x4 get_rotation_x(float angle)
{
    struct mat4x4 m = {
        .m = {
            {1, 0, 0, 0},
            {0, _cos(angle), -_sin(angle), 0},
            {0, _sin(angle), _cos(angle), 0},
            {0, 0, 0, 1}
        }
    };

    return m;
}

struct mat4x4 get_rotation_y(float angle)
{
    struct mat4x4 m = {
        .m = {
            {_cos(angle), 0, _sin(angle), 0},
            {0, 1, 0, 0},
            {-_sin(angle), 0, _cos(angle), 0},
            {0, 0, 0, 1}
        }
    };

    return m;
}

struct mat4x4 matmul(struct mat4x4* a, struct mat4x4* b)
{
    struct mat4x4 res;

    for (int i = 0; i < 4; i++)
        for (int j = 0; j < 4; j++)
            res.m[i][j] = a->m[i][0] * b->m[0][j] + a->m[i][1] * b->m[1][j] + a->m[i][2] * b->m[2][j] + a->m[i][3] * b->m[3][j];

    return res;
}

void transform_vertex(struct Vertex* v, struct mat4x4* m)
{
    struct Vertex res;

    res.x = m->m[0][0] * v->x + m->m[0][1] * v->y + m->m[0][2] * v->z + m->m[0][3] * v->w;
    res.y = m->m[1][0] * v->x + m->m[1][1] * v->y + m->m[1][2] * v->z + m->m[1][3] * v->w;
    res.z = m->m[2][0] * v->x + m->m[2][1] * v->y + m->m[2][2] * v->z + m->m[2][3] * v->w;
    res.w = m->m[3][0] * v->x + m->m[3][1] * v->y + m->m[3][2] * v->z + m->m[3][3] * v->w;
    res.color = v->color;

    *v = res;
}

#define MIN(a, b) ((a) < (b) ? (a) : (b))
#define MAX(a, b) ((a) > (b) ? (a) : (b))
#define CLAMP(x, min, max) ((x) < (min) ? (min) : ((x) > (max) ? (max) : (x)))
#define FLOOR(x) ((x) < 0 ? (int)((x) - 1) : (int)(x))
#define CEIL(x) ((x) < 0 ? (int)(x) : (int)((x) + 1))

uint32_t color_mix(uint32_t c1, uint32_t c2, uint32_t c3, float alpha, float beta, float gamma)
{
    float r1 = ((c1 >> 16) & 0xff) / 255.0f;
    float g1 = ((c1 >> 8) & 0xff) / 255.0f;
    float b1 = (c1 & 0xff) / 255.0f;

    float r2 = ((c2 >> 16) & 0xff) / 255.0f;
    float g2 = ((c2 >> 8) & 0xff) / 255.0f;
    float b2 = (c2 & 0xff) / 255.0f;

    float r3 = ((c3 >> 16) & 0xff) / 255.0f;
    float g3 = ((c3 >> 8) & 0xff) / 255.0f;
    float b3 = (c3 & 0xff) / 255.0f;

    float r = alpha * r1 + beta * r2 + gamma * r3;
    float g = alpha * g1 + beta * g2 + gamma * g3;
    float b = alpha * b1 + beta * b2 + gamma * b3;

    r = CLAMP(r, 0, 1) * 255;
    g = CLAMP(g, 0, 1) * 255;
    b = CLAMP(b, 0, 1) * 255;

    return ((int)r << 16) | ((int)g << 8) | (int)b;
}

uint32_t compute_light(float nx, float ny, float nz)
{
    const float light_dir[3] = { 0, 0, -1 };
    float dot = nx * light_dir[0] + ny * light_dir[1] + nz * light_dir[2];

    if (dot < 0)
        dot = 0;

    uint8_t c = dot * 255;

    return (c << 16) | (c << 8) | c;
}

void draw_triangle(struct Vertex* v1, struct Vertex* v2, struct Vertex* v3, uint32_t color)
{
    float x1 = (v1->x + 1) * 0.5 * WIDTH;
    float y1 = (1 - v1->y) * 0.5 * HEIGHT;

    float x2 = (v2->x + 1) * 0.5 * WIDTH;
    float y2 = (1 - v2->y) * 0.5 * HEIGHT;

    float x3 = (v3->x + 1) * 0.5 * WIDTH;
    float y3 = (1 - v3->y) * 0.5 * HEIGHT;

    int x_min = CLAMP(FLOOR(MIN(MIN(x1, x2), x3)), 0, WIDTH - 1);
    int x_max = CLAMP(CEIL(MAX(MAX(x1, x2), x3)), 0, WIDTH - 1);
    int y_min = CLAMP(FLOOR(MIN(MIN(y1, y2), y3)), 0, HEIGHT - 1);
    int y_max = CLAMP(CEIL(MAX(MAX(y1, y2), y3)), 0, HEIGHT - 1);

    float denom = ((y2 - y3) * (x1 - x3) + (x3 - x2) * (y1 - y3));

    for (int y = y_min; y <= y_max; y++)
    {
        for (int x = x_min; x <= x_max; x++)
        {
            float px = (float)x + 0.5f;
            float py = (float)y + 0.5f;

            float alpha = ((y2 - y3) * (px - x3) + (x3 - x2) * (py - y3)) / denom;
            float beta = ((y3 - y1) * (px - x3) + (x1 - x3) * (py - y3)) / denom;
            float gamma = 1.0f - alpha - beta;

            if (alpha >= -0.001f && beta >= -0.001f && gamma >= -0.001f)
            {
                float depth = v1->z * alpha + v2->z * beta + v3->z * gamma;
                float current_depth = depthbuf[y * WIDTH + x];

                if (depth > current_depth)
                    continue;

                // uint32_t color = color_mix(v1->color, v2->color, v3->color, alpha, beta, gamma);

                backbuf[y * WIDTH + x] = color;
                depthbuf[y * WIDTH + x] = depth;
            }
        }
    }
}

void normalize_coords(struct Vertex* v)
{
    v->x /= v->w;
    v->y /= v->w;
    v->z /= v->w;
    v->w = 1.0f;
}

#include <xmmintrin.h>

static inline __m128 cross_product(__m128 a, __m128 b) {
    // a = (ax, ay, az, 0)
    // b = (bx, by, bz, 0)
    __m128 a_yzx = _mm_shuffle_ps(a, a, _MM_SHUFFLE(3, 0, 2, 1)); // ay, az, ax
    __m128 b_yzx = _mm_shuffle_ps(b, b, _MM_SHUFFLE(3, 0, 2, 1)); // by, bz, bx

    __m128 c = _mm_sub_ps(
        _mm_mul_ps(a, b_yzx),
        _mm_mul_ps(a_yzx, b)
    );

    return _mm_shuffle_ps(c, c, _MM_SHUFFLE(3, 0, 2, 1)); // rotate back
}

void compute_normal(struct Vertex* v1, struct Vertex* v2, struct Vertex* v3, float n[3]) {
    // Load v1, v2, v3 into SSE registers
    __m128 p1 = _mm_set_ps(0.0f, v1->z, v1->y, v1->x);
    __m128 p2 = _mm_set_ps(0.0f, v2->z, v2->y, v2->x);
    __m128 p3 = _mm_set_ps(0.0f, v3->z, v3->y, v3->x);

    // Compute edge vectors
    __m128 ab = _mm_sub_ps(p2, p1);
    __m128 ac = _mm_sub_ps(p3, p1);

    // Cross product: normal = ab x ac
    __m128 normal = cross_product(ab, ac);

    // Compute length squared: dot(normal, normal)
    __m128 squared = _mm_mul_ps(normal, normal);
    __m128 shuf1 = _mm_shuffle_ps(squared, squared, _MM_SHUFFLE(2, 1, 0, 3));
    __m128 sum = _mm_add_ps(squared, shuf1);
    __m128 shuf2 = _mm_movehl_ps(sum, sum);
    __m128 len_sq = _mm_add_ss(sum, shuf2);

    __m128 inv_len = _mm_rsqrt_ss(len_sq);
    inv_len = _mm_shuffle_ps(inv_len, inv_len, _MM_SHUFFLE(0, 0, 0, 0)); // broadcast

    // Normalize
    __m128 norm = _mm_mul_ps(normal, inv_len);

    // Store result
    _mm_store_ss(&n[0], norm);                             // x
    _mm_store_ss(&n[1], _mm_shuffle_ps(norm, norm, 0x55)); // y
    _mm_store_ss(&n[2], _mm_shuffle_ps(norm, norm, 0xAA)); // z
}

void draw_vertices(struct Vertex* verts, int count, struct mat4x4* mat)
{
    for (int i = 0; i < count; i += 3)
    {
        struct Vertex v1 = verts[i];
        struct Vertex v2 = verts[i + 1];
        struct Vertex v3 = verts[i + 2];

        float n[3];

        if (mat)
        {
            transform_vertex(&v1, mat);
            transform_vertex(&v2, mat);
            transform_vertex(&v3, mat);
        }

        compute_normal(&v1, &v2, &v3, n);

        if (n[0] * v1.x + n[1] * v1.y + n[2] * v1.z > 0)
            continue;

        uint32_t color = compute_light(n[0], n[1], n[2]);

        normalize_coords(&v1);
        normalize_coords(&v2);
        normalize_coords(&v3);

        draw_triangle(&v1, &v2, &v3, color);
    }
}

int main(int argc, char** argv)
{
#ifdef LINUX
    fb = open("/dev/fb0", O_RDWR);
#else
    open("/dev/fbterm", O_RDWR, 0);
    dup(0);
    dup(0);
    fb = open("/dev/fb", O_RDWR, 0);

    ioctl(fb, FB_GET_WIDTH, &width);
    ioctl(fb, FB_GET_HEIGHT, &height);

    unsigned long brk_start = brk(0);
    brk((char*)brk_start + 2 * WIDTH * HEIGHT * 4);
    backbuf = (uint32_t*)brk_start;
    depthbuf = (float*)(backbuf + WIDTH * HEIGHT);

    ioctl(STDIN_FILENO, FBTERM_LB_OFF, 0);
    ioctl(STDIN_FILENO, FBTERM_ECHO_OFF, 0);
#endif

    if (fb < 0)
    {
        write(1, "open: failed\n", 13);
        return -1;
    }

    struct mat4x4 proj = get_projection(0.1, 100, PI / 3, (float)WIDTH / (float)HEIGHT);
    struct mat4x4 view = get_translation(0, 0, 8);
    struct mat4x4 mvp = matmul(&proj, &view);

    struct mat4x4 x_rot = get_rotation_x(0.01);
    struct mat4x4 y_rot = get_rotation_y(0.02);
    struct mat4x4 rot = matmul(&x_rot, &y_rot);

    while (1)
    {
#ifndef LINUX
        char ch;
        if (read(0, &ch, 1) == 1 && ch == 'q')
            break;
#endif

        clear_screen(0x000000);

        draw_vertices(model, sizeof(model) / sizeof(struct Vertex), &mvp);

        for (int i = 0; i < sizeof(model) / sizeof(struct Vertex); i++)
            transform_vertex(&model[i], &rot);

        blit();
    }

#ifndef LINUX
    ioctl(STDIN_FILENO, FBTERM_ECHO_ON, 0);
    ioctl(STDIN_FILENO, FBTERM_LB_ON, 0);
#endif

    return 0;
}
